import { Table, Tag, Space } from 'antd';
import { Container } from '../../../style';
import { OrdersWrapper } from './style';

const Orders = () => {
  const dataSource = [
    {
      key: '1',
      name: 'Mike',
      age: 32,
      address: '10 Downing Street',
    },
    {
      key: '2',
      name: 'John',
      age: 42,
      address: '10 Downing Street',
    },
  ];

  const columns = [
    {
      title: 'Name',
      dataIndex: 'name',
      key: 'name',
    },
    {
      title: 'Age',
      dataIndex: 'age',
      key: 'age',
    },
    {
      title: 'Address',
      dataIndex: 'address',
      key: 'address',
    },
  ];

  return (
    <OrdersWrapper>
      <Table dataSource={dataSource} columns={columns} pagination={false} style={{ width: '100%' }} />
    </OrdersWrapper>
  )
}

export default Orders
